Nadat het stedelijk koppel Linda en George (Jennifer Aniston en Paul Rudd) een huis koopt in New York, verliest George zijn baan. Doordat ze geen andere optie hebben besluit het koppel naar Georgia te verhuizen om bij familie in te trekken. Op weg er naar toe overnachten ze in een Bed &amp; Breakfast wat een nudistengemeenschap blijkt te zijn.



